import React from 'react'
import styled from "styled-components";
import Logo from "../assets/logo.png";


const Home = () => {
  return (
    <>
        <Container className='cont'>
            <div className="home">
                <div className="nav">
                    <img src={Logo} alt="logo" />
                </div>
            </div>
            

        </Container>
    </>
  )
}

export default Home;

const Container = styled.div`
Container{
    background: yellow;
}
.home{
    
}
.nav{
    padding:1rem;
}
img {
    height: 2rem;
  }

`;
